import Header from "../../components/Header";
import Container from "../../components/Container";
import Footer from "../../components/Footer";
import Form from "../../components/Form";

function VideoCadastre(){
    return(
        <>
            <Header />
            <Container>
                <Form />
            </Container>
            <Footer />
        </>
    );
}

export default VideoCadastre;
